import React from 'react';
import { Routes, Route, BrowserRouter } from 'react-router-dom';
import FirstScreen from './screens/FirstScreen';

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/">
          <FirstScreen />
        </Route>
        <Route path="/focus">
          <div>Focus</div>
        </Route>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
